import CartItem  from './CartItem'

export default function CartList({props}) {


        return (
            <div className="contanier-fluid">
                    {props.cart.map(item =>
                        {
                            return <CartItem key={item.id}
                            item={item}
                            value={props}
                            />
                        })}

            </div>
        );
    }
